import React from "react";
import Head from "next/head";

const Footer = () => {
  return (
    <React.Fragment>
      <Head>
        <script
          src="https://kit.fontawesome.com/a40d908160.js"
          crossOrigin="anonymous"
        />
      </Head>
      <footer>
        <a href={"https://www.instagram.com/linghandmade18/"}>
          <i className="fab fa-instagram" />
        </a>
      </footer>

      <style jsx>{`
        footer {
          border-top: 1px solid #e4dbcc;
          margin-top: 8px;
          display: flex;
          justify-content: center;
          height: 250px;
        }

        form {
          margin-top: 30px;
          display: flex;
          flex-direction: column;
          justify-content: center;
          margin-bottom: 30px;
        }

        input {
          height: 30px;
          border-radius: 2px;
          border: 1px solid #d3d3d3;
          margin: 5px 0;
        }

        button {
          width: 90px;
          height: 30px;
          color: white;
          background: #92214a;
          border: 1px solid #92214a;
          border-radius: 2px;
        }

        p {
          width: 300px;
          font-size: 0.9rem;
          margin-top: 40px;
          margin-left: 4em;
          color: grey;
        }
      `}</style>
    </React.Fragment>
  );
};

export default Footer;
